import React from "react";
import { useEffect,useState } from "react";
import axios from "axios";


function Home() {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:3000/users')    
      .then(res=>{
setData(res.data)})
      .catch(err=>{
console.log(err)});

    }, []);

  return (

    <React.Fragment>
         <div className="container d-flex flex-column justify-content-center align-items-center vh-100">
         <h1 className="text-primary fw-bold">LIST OF USERS</h1>
         <table className="table table-stripped table-hover bg-warning">
            <thead>
                <tr>
                <th>ID</th>
                <th>NAME</th>
                <th>EMAIL</th>
                <th>PHONE</th>
                <th>WEBSITE</th>
                <th>ACTION</th>
                </tr>
            </thead>
            <tbody>
                {
                    data.map((data, index) =>(
                            <tr key={index} className="p-3 mb-3">
                                <td>{data.id}</td>
                                <td>{data.name}</td>
                                <td>{data.email}</td>
                                <td>{data.phone}</td>
                                <td>{data.website}</td>
                               <td>
                                  <button className="btn btn-sm btn-danger">READ</button>
                                  <button className="btn btn-sm btn-primary me-2 ">EDIT</button>
                                  <button className="btn btn-sm btn-danger">DELETE</button></td>
                             </tr>
                    ))
                }
            </tbody>        

         </table>

         </div>

    </React.Fragment>

  )
}

export default Home;
